import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import Heading from "./heading";
import Para from "./Para";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <>
    <Heading />

    <ol>
      <li>Item 1</li>
      <li>Item 2</li>
      <li>Item 3</li>
      <li>Item 4</li>
    </ol>
  </>
);
